(6, '#ffffff', '#fa0000', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;بناءا على الظهير الشريف الصادر بتاريخ 25 نونبر 1924 اي ما يقارب 100 سنة من صدوره ويتعلق بالاختصاص الحصري للبريد في نقل الحزم والاوراق التي وزنها كيلو 1 او اقل وبناء عليه و تطبيقا لنص الظهير نعلمك انه يمنع ارسال الطرود اقل من 1 كيلوغرام نشكركم على تفهمكم وتعاونكم المستمر&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n&lt;div name=&quot;aibuy-plugin-check&quot; style=&quot;display: none;&quot;&gt;&lt;br /&gt;&lt;/div&gt;', 'user', 'alert', 0, '', 0),
(7, '#050000', '#ebf561', '&lt;span style=&quot;font-weight: bold;&quot;&gt;خدمة طلب الرمساج من الساعة 10 صباحا إلى 18 زوالآ على الرقم 0667433241&lt;/span&gt;', 'user', 'alert', 0, '', 0),
(8, '#f5f5f5', '#fb0404', '&lt;span style=&quot;font-weight: bold;&quot;&gt;في حالة تغيير او ستبدال منتج لزبون المرجو تصريح به عند ملء الطلبية وإرسال رمزه لخدمة تتبع الطلبيات&amp;nbsp; 0667659226/ في حالة عدم التصريح نحن لسنا مسؤولين شكرا لتفهمكم&lt;/span&gt;\r\n\r\n\r\n\r\n\r\n&lt;div class=&quot;cbu-aibuy-login&quot;&gt;&lt;br /&gt;&lt;/div&gt;\r\n\r\n\r\n\r\n\r\n&lt;div class=&quot;1688-aibuy-drawer&quot;&gt;&lt;br /&gt;&lt;/div&gt;\r\n\r\n\r\n\r\n\r\n&lt;div class=&quot;1688-aibuy-search-icon&quot; style=&quot;display: none;&quot;&gt;&lt;div class=&quot;cbu-aibuy-trigger-btn-container &quot;&gt;&lt;div class=&quot;aibuy-trigger-btn-wrapper&quot;&gt;&lt;img src=&quot;chrome-extension://ecpkhbhhpfjkkcedaejmpaabpdgcaegc/assets/search-image-icon.png&quot; alt=&quot;&quot; /&gt;&lt;/div&gt;&lt;div class=&quot;aibuy-trigger-btn-text&quot;&gt;&lt;img src=&quot;chrome-extension://ecpkhbhhpfjkkcedaejmpaabpdgcaegc/assets/search-image-text-icon.png&quot; alt=&quot;&quot; /&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'user', 'alert', 0, '', 0),
(11, '#ffffff', '#e67a00', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;السلام عليكم ورحمة الله،\r\n\r\nيسعدنا أن نرحّب بكم في موقعنا الجديد \r\nلقد حرصنا على تطوير منصتنا الرقمية لتكون أكثر حداثة، سهولة، وفعالية، حتى نوفّر لكم تجربة سلسة وخدمات متكاملة تُلبي جميع احتياجاتكم.\r\n\r\n مع الموقع الجديد، تستفيدون من:\r\n\r\nواجهة حديثة وبسيطة الاستخدام\r\n\r\nنظام تتبّع أسرع وأكثر وضوحاً للطلبيات.&amp;nbsp; امتيازات وخدمات إضافية مخصّصة  التي ستجعل تجارتكم أسهل وأكثر نجاحاً.\r\n\r\nشكراً لثقتكم في ، وديما رهن إشارتكم لخدمتكم بأعلى معايير الجودة \r\n\r\nمع كامل التقدير&lt;/span&gt;&lt;/p&gt;\r\n&lt;div class=&quot;cbu-aibuy-login&quot;&gt;&lt;/div&gt;\r\n&lt;div class=&quot;1688-aibuy-drawer&quot;&gt;&lt;/div&gt;\r\n&lt;div class=&quot;1688-aibuy-search-icon&quot; style=&quot;display: none;&quot;&gt;&lt;div class=&quot;cbu-aibuy-trigger-btn-container &quot;&gt;&lt;div class=&quot;aibuy-trigger-btn-wrapper&quot;&gt;&lt;img src=&quot;chrome-extension://ecpkhbhhpfjkkcedaejmpaabpdgcaegc/assets/search-image-icon.png&quot; alt=&quot;&quot; /&gt;&lt;/div&gt;&lt;div class=&quot;aibuy-trigger-btn-text&quot;&gt;&lt;img src=&quot;chrome-extension://ecpkhbhhpfjkkcedaejmpaabpdgcaegc/assets/search-image-text-icon.png&quot; alt=&quot;&quot; /&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 'user', 'alert', 0, '', 0);
